        [HttpPost]
        public string generate_guivalue([FromBody] loginmodel data)
        {
            Guid g = Guid.NewGuid();

            HttpContext.Session.SetString("Guid", "");
            Guid guid_value = new Guid(g.ToString());
            bool boo_guid = ValidateGuid(guid_value.ToString());
            if (boo_guid == true)
                HttpContext.Session.SetString("Guid", guid_value.ToString());

            else

                HttpContext.Session.SetString("Guid", "");
            Common.Global.guidvalue = HttpContext.Session.GetString("Guid");

            return Common.Global.guidvalue;
        }

