        public List<MyPermission> Aval_Permission(DataTable dt_Aval)
        {
            List<MyPermission> aval_perm = new List<MyPermission>();
            foreach (DataRow dr in dt_Aval.Rows)
            {
                MyPermission newPerm = new MyPermission();
                newPerm.ScreenId = dr["screen_id"].ToString();
                newPerm.AddPerm = dr["add_perm"].ToString();
                newPerm.ModPerm = dr["mod_perm"].ToString();
                newPerm.ViewPerm = dr["view_perm"].ToString();
                newPerm.AuthPerm = dr["auth_perm"].ToString();
                newPerm.InactPerm = dr["inactivate_perm"].ToString();
                newPerm.PrnPerm = dr["print_perm"].ToString();
                newPerm.DenyPerm = dr["deny_perm"].ToString();
                aval_perm.Add(newPerm);
            }
            return aval_perm;
        }

